const concat = function(arrs,condition,trueCondition){
	const bucket = [];
	arrs.forEach(arr=>{
		arr.forEach(item=>{
			if(condition(item,bucket)){
				trueCondition(item,bucket);
			}
		})
	})
	return bucket;
}

